  `longitude` varchar(50) DEFAULT NULL COMMENT '经度',
  `is_main` int(11) DEFAULT NULL COMMENT '是否主柜（1为主柜、0从柜）',
  `open_stauts` char(50) DEFAULT NULL COMMENT '柜门：1、打开，2，关闭',
