  `humidity` varchar(50) DEFAULT NULL COMMENT '器具柜湿度',
  `lock` varchar(50) DEFAULT NULL COMMENT '器具柜锁',
  `matter_num` int(11) DEFAULT NULL COMMENT 'EPC在库数量',
  `state_cantact` varchar(50) DEFAULT NULL COMMENT '锁磁状态:1:开启2：关闭',
  `state_bolt` varchar(50) DEFAULT NULL COMMENT '柜锁状态:1:开启2：关闭',
  `ventilation` varchar(50) DEFAULT NULL COMMENT '通风状态：1、打开，2，关闭',
  `ventilation_fan1` varchar(10) DEFAULT NULL COMMENT '通风模块 风机1的DI位为2  1、打开，2，关闭',
  `ventilation_fan2` varchar(10) DEFAULT NULL COMMENT '通风模块 风机2的DI位为3  1、打开，2，关闭',
  `light` varchar(50) DEFAULT NULL COMMENT '柜灯状态：1、打开，2，关闭',
  `dehumidification` varchar(50) DEFAULT NULL COMMENT '除湿状态：1、打开，2，关闭',
  `dehumidification_fan1` varchar(10) DEFAULT NULL COMMENT '除湿模块 风机1的DI位为2   1、打开，2，关闭',
  `dehumidification_fan2` varchar(10) DEFAULT NULL COMMENT '除湿模块 风机2的DI位为3   1、打开，2，关闭',
  `dehumidification_hot1` varchar(10) DEFAULT NULL COMMENT '除湿模块 风机1的DI位为2   1、打开，2，关闭',
  `dehumidification_hot2` varchar(10) DEFAULT NULL COMMENT '除湿模块 风机2的DI位为2   1、打开，2，关闭',
  `temperature_hight_set` double DEFAULT NULL COMMENT '温度设定值',
  `humidity_hight_set` double DEFAULT NULL COMMENT '湿度设定值',
  `temperature_set` double DEFAULT NULL COMMENT '温度阀值',
  `humidity_set` double DEFAULT NULL COMMENT '湿度阀值',
  `discharge_air_time_out` double DEFAULT NULL COMMENT '排风延时 秒',
  `dehumidify_time_out` double DEFAULT NULL COMMENT '除湿延时',
  `warning_temperature` double DEFAULT NULL COMMENT '报警温度',
  `warning_humidity` double DEFAULT NULL COMMENT '报警湿度',
  `warning_temperature_low` double DEFAULT NULL COMMENT '报警温度低限',
  `warning_humidity_low` double DEFAULT NULL COMMENT '报警湿度低限',
  `lock_back_time` double DEFAULT NULL COMMENT '锁舌回退时间（秒）',
  `lock_close_try` double DEFAULT NULL COMMENT '锁闭尝试（次）',
  `label_discovery` varchar(10) DEFAULT NULL COMMENT '标签发现',
  `ctl_logic` varchar(50) DEFAULT NULL COMMENT '控制逻辑 0 解耦控制，1 通风优先，2 恒温优优 ，3 恒湿优先',
  `run_config` varchar(50) DEFAULT NULL COMMENT '运行配置（0双机运行、1混运行、2单机运行）',
  `ctl_operation` varchar(50) DEFAULT NULL COMMENT '控制操作 1自动、2遥控（手工运行）',
  `sensor_no` varchar(50) DEFAULT NULL COMMENT '传感器编号',
