-- 导出  表 hdpt_base_prd.task 结构
CREATE TABLE IF NOT EXISTS `task` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `parent_id` int(11) DEFAULT NULL COMMENT '父ID',
  `req_code` varchar(255) DEFAULT NULL COMMENT '请求编号，每个请求要唯一编号',
  `job_id` varchar(255) DEFAULT NULL COMMENT '作业编号，同一个作业编号的多个指令必须由一个AGV执行',
  `order_id` varchar(255) DEFAULT NULL COMMENT '指令编号',
  `order_type` varchar(255) DEFAULT NULL COMMENT '指令类型, carry搬运，move行走，charge充电',
  `from` varchar(255) DEFAULT NULL COMMENT '搬运或行走指令起点(如果起点为空，则agv当前位置为起点)',
  `to` varchar(255) DEFAULT NULL COMMENT '搬运或行走指令终点',
  `is_drop` varchar(255) DEFAULT NULL COMMENT '到达终点是否放货，1：放货 0：不放货',
  `is_last_order` varchar(255) DEFAULT NULL COMMENT '是否作业最后一个指令，1：是 0：不是；如果是最后一个指令，完成该指令后，释放AGV',
  `priority` varchar(255) DEFAULT NULL COMMENT '指令优先级,1~5级，值越大，优先级越高',
  `job_status` varchar(255) DEFAULT NULL COMMENT '作业状态1：执行中；0待执行;-1 执行失败;2关联任务待执行',
  `car_no` varchar(255) DEFAULT NULL COMMENT '执行任务的小车编号',
  `is_has_job_id` varchar(255) DEFAULT NULL COMMENT '执行中和待执行任务中是否有相同的作业编号',
  `task_id` varchar(255) DEFAULT NULL COMMENT '任务编号',
  `task_time` bigint(20) DEFAULT NULL COMMENT 'mes下发任务时间 任务超过一天 就删除',
  `job_id_agv` varchar(255) DEFAULT NULL COMMENT 'AGV 任务ID',
  `agv_id` varchar(255) DEFAULT NULL COMMENT '执行任务的AGV',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='小车任务表';

